import "./Upper.css";

const Upper=()=>{
    return(
        <div className="upper">
            <div className="up-text">
                <h2>Our Papers</h2>
                <p>International Journal of Research in Science and Technology (IJRST) is a peer-reviewed, quarterly, and peer refereed scholarly open access scientific research journal. It provides a venue for the dissemination of research findings and findings with a significant empirical component. Its goal is to close the gap between theory and practice by encouraging the publication of creative, innovative, and industry-relevant research.</p>
                <br></br>
                <p>IJRST's quest is to publish original and unpublished research articles, review articles, survey papers, refereed articles, as well as auxiliary material such as case studies, technical articles, short communications, Symposium, Commentary, Perspective, Conceptual Paper, and Proceeding based on theoretical or experimental works in all fields of science and technology, without regard to budget constraints.</p>
            </div>
            <div className="up-img">
            <img src="./images/img-60.jpg" alt=''/>
            </div>
            
            
        </div>

    
    )
}

export default Upper;
